UNION
select idEvento, idMeio, t.idData from eventoemergencia natural join acciona natural join meiocombate natural join d_evento natural join d_meio inner join d_tempo t on t.dia = date_part('day', instanteChamada) and t.mes = date_part('month', instanteChamada) and t.ano = date_part('year', instanteChamada) where tipo = 'MeioCombate');